	function openPopup(id) {
		$(id).show();
		$('body').addClass('no-scroll-mob');
		if ( $(window).width() < 992 ) {
			$('body').removeClass('scroll');
		}
		document.addEventListener('touchmove', function(e) {e.preventDefault();}, true);
		setTimeout(() => {
			$(id).addClass('opened')
		}, 50)
		setTimeout(() => {
			$('.map-loader').removeClass('opened')
		}, 1050)
		setTimeout(() => {
			$('.map-loader').hide()
		}, 1650)
	}

